import React from 'react';

export default function SideItem(props) {
	return (
		<div className="mt-6 flex">
			<img src={`./assets/icons/chat.png`} alt="" />
			<button className="mx-4 text-gray-800 font-medium text-md focus:outline-none">
				{props.name}
			</button>
		</div>
	);
}
